import React from "react";
import Stock from "./Stock";
import Prediction from "./Prediction";

const PassText = ({ someText, setPrediction }) => {
  return (
    <div>
      {someText.symbol && (
        <>
          <h1>{someText.symbol}</h1>
          <Stock sign={someText.symbol} setPrediction={setPrediction} />
          <div>
            The prediction is that this stock goes{" "}
            <span style={{ whiteSpace: "nowrap" }}>
              <Prediction pred="2" />
            </span>{" "}
            in price.
          </div>
        </>
      )}
    </div>
  );
};

export default PassText;
